sql_command:
SELECT AVG(l.balance) AS average_loan_balance
FROM banking_new."Loans" l
JOIN banking_new."Deposits" d ON l.customer_id = d.customer_id;

SELECT COUNT(*) AS customer_count
FROM banking_new."Cards"
WHERE is_blocked = TRUE AND expiration_date < CURRENT_DATE;

SELECT COUNT(*)
FROM banking_new."Transactions"
WHERE transaction_amount > (SELECT AVG(transaction_amount) FROM banking_new."Transactions");

SELECT COUNT(*) AS num_deposits_above_avg
FROM banking_new."Deposits"
WHERE balance > (SELECT AVG(balance) FROM banking_new."Deposits");

SELECT COUNT(*) AS num_loans_above_avg_balance
FROM banking_new."Loans"
WHERE balance > (SELECT AVG(balance) FROM banking_new."Loans");

SELECT COUNT(*)
FROM banking_new."Loans" l
WHERE l."interest_rate" > (
    SELECT AVG("interest_rate")
    FROM banking_new."Loans"
);

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 100 AND 1000;

SELECT COUNT(*) AS num_deposits
FROM banking_new."Deposits"
WHERE start_date > '2024-01-01';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE end_date < '2026-01-01';

SELECT COUNT(*) AS number_of_deposits
FROM banking_new."Deposits"
WHERE "term" BETWEEN '06-01' AND '12-31';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE payment_term BETWEEN '12 months' AND '24 months';

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE updated_at >= NOW() - INTERVAL '1 week';

SELECT COUNT(*) AS count_of_deposits
FROM banking_new."Deposits"
WHERE end_date BETWEEN NOW() AND NOW() + INTERVAL '6 months';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE interest_rate BETWEEN 0.03 AND 0.05;

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount > 1000 AND transaction_date >= NOW() - INTERVAL '1 YEAR';

SELECT COUNT(*) AS num_deposits
FROM banking_new."Deposits"
WHERE "term" > '12 months';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE "interest_rate" > 6;

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 50 AND 200;

SELECT COUNT(*) AS count_of_deposits
FROM banking_new."Deposits"
WHERE start_date > '2023-01-01';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE end_date < '2025-01-01';

SELECT COUNT(*) AS number_of_deposits
FROM banking_new."Deposits"
WHERE "term" BETWEEN '03-01' AND '06-01';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE payment_term BETWEEN '6 months' AND '12 months';

SELECT COUNT(*) AS num_transactions_updated
FROM banking_new."Transactions"
WHERE updated_at >= NOW() - INTERVAL '30 days';

SELECT COUNT(*) AS count_of_deposits
FROM banking_new."Deposits"
WHERE EXTRACT(YEAR FROM age(end_date, NOW())) < 1;

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE interest_rate BETWEEN 0.04 AND 0.06;

SELECT COUNT(*) AS num_deposits
FROM banking_new."Deposits"
WHERE "term" > '24 months';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE "interest_rate" > 7;

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount BETWEEN 1000 AND 5000;

SELECT COUNT(*) AS num_deposits
FROM banking_new."Deposits"
WHERE start_date > '2022-01-01';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE end_date < '2024-01-01';

SELECT COUNT(*) AS number_of_deposits
FROM banking_new."Deposits"
WHERE "term" BETWEEN '12' AND '24';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE payment_term BETWEEN '24 months' AND '36 months';

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE updated_at >= NOW() - INTERVAL '60 days';

SELECT COUNT(*) AS count_of_deposits
FROM banking_new."Deposits"
WHERE end_date BETWEEN NOW() AND NOW() + INTERVAL '3 MONTH';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE interest_rate BETWEEN 0.02 AND 0.04;

SELECT COUNT(t.transaction_id) AS transaction_count
FROM banking_new."Transactions" t
JOIN banking_new."Accounts" a ON t.account_id = a.account_id;

SELECT COUNT(DISTINCT c.customer_id) AS number_of_cards_linked_to_customers_with_deposits
FROM banking_new."Cards" c
JOIN banking_new."Deposits" d ON c.customer_id = d.customer_id;

SELECT COUNT(*) AS expired_deposits_count
FROM banking_new."Deposits"
WHERE end_date < CURRENT_DATE;

SELECT COUNT(*) AS expired_loans_count
FROM banking_new."Loans" 
WHERE end_date < CURRENT_DATE;

SELECT COUNT(*) AS active_deposits_count
FROM banking_new."Deposits"
WHERE end_date IS NULL;

SELECT COUNT(*) AS active_loans_count
FROM banking_new."Loans"
WHERE NOT end_date IS NOT NULL;

SELECT COUNT(*) AS total_blocked_cards
FROM banking_new."Cards"
WHERE is_blocked = TRUE;

SELECT COUNT(*) AS total_unblocked_cards
FROM banking_new."Cards"
WHERE "is_blocked" = FALSE;

SELECT COUNT(*) AS active_loans_count
FROM banking_new."Loans"
WHERE end_date IS NULL;

SELECT COUNT(*) AS customer_count
FROM banking_new."Customers"
WHERE date_of_birth > '1990-12-31';

SELECT COUNT(*) AS customer_count
FROM banking_new."Customers"
WHERE date_of_birth < '1980-01-01';

SELECT COUNT(*)
FROM banking_new."Accounts"
WHERE account_number LIKE 'CA-%';

SELECT COUNT(*)
FROM banking_new."Loans"
WHERE "balance" > 10000;

SELECT COUNT(*) AS number_of_deposits
FROM banking_new."Deposits"
WHERE balance < 5000;

SELECT COUNT(*) AS transaction_count
FROM banking_new."Transactions"
WHERE transaction_amount > 1000;

SELECT COUNT(*) AS branch_count
FROM banking_new."Branches"
