SELECT COUNT(*) AS account_count
FROM banking_new."Accounts"
WHERE created_at > '2020-01-01';

SELECT COUNT(*) AS loan_count
FROM banking_new."Loans"
WHERE EXTRACT(YEAR FROM start_date) = 2022;

SELECT COUNT(*) AS number_of_deposits
FROM banking_new."Deposits"
WHERE EXTRACT(YEAR FROM "start_date") = 2021;

SELECT COUNT(*) AS customer_count
FROM banking_new."Customers"
