SELECT COUNT(*) AS overdue_loans_count
FROM banking_new."Loans"
WHERE end_date < CURRENT_DATE AND balance > 0;

SELECT COUNT(*) AS closed_loans_count
FROM banking_new."Loans"
WHERE end_date < CURRENT_DATE;

SELECT COUNT(*) AS active_deposits_count
FROM banking_new."Deposits"
WHERE end_date IS NULL;

SELECT COUNT(*) AS number_of_closed_deposits
FROM banking_new."Deposits"
WHERE "end_date" IS NOT NULL;

SELECT COUNT(*) AS failed_transactions_count
FROM banking_new."Transactions"
WHERE transaction_amount = 0 AND transaction_date IS NOT NULL;

SELECT COUNT(*) AS customer_count
FROM banking_new."Customers"
WHERE date_of_birth BETWEEN '2022-01-01' AND '2022-12-31';

SELECT COUNT(*) AS customer_count
FROM banking_new."Customers"
WHERE EXTRACT(YEAR FROM created_at) = 2023;

SELECT COUNT(*) AS customer_count
FROM banking_new."Customers"
WHERE date_of_birth > CURRENT_DATE - INTERVAL '18 years';
